package com.nettactic.mall.bean;

public class QQInfo {

	private String is_yellow_vip, yellow_vip_level, profile_image_url,
			screen_name, msg, vip, city, gender, province, level,
			is_yellow_year_vip, openid;

	public QQInfo() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getIs_yellow_vip() {
		return is_yellow_vip;
	}

	public void setIs_yellow_vip(String is_yellow_vip) {
		this.is_yellow_vip = is_yellow_vip;
	}

	public String getYellow_vip_level() {
		return yellow_vip_level;
	}

	public void setYellow_vip_level(String yellow_vip_level) {
		this.yellow_vip_level = yellow_vip_level;
	}

	public String getProfile_image_url() {
		return profile_image_url;
	}

	public void setProfile_image_url(String profile_image_url) {
		this.profile_image_url = profile_image_url;
	}

	public String getScreen_name() {
		return screen_name;
	}

	public void setScreen_name(String screen_name) {
		this.screen_name = screen_name;
	}

	public String getMsg() {
		return msg;
	}

	public void setMsg(String msg) {
		this.msg = msg;
	}

	public String getVip() {
		return vip;
	}

	public void setVip(String vip) {
		this.vip = vip;
	}

	public String getCity() {
		return city;
	}

	public void setCity(String city) {
		this.city = city;
	}

	public String getGender() {
		return gender;
	}

	public void setGender(String gender) {
		this.gender = gender;
	}

	public String getProvince() {
		return province;
	}

	public void setProvince(String province) {
		this.province = province;
	}

	public String getLevel() {
		return level;
	}

	public void setLevel(String level) {
		this.level = level;
	}

	public String getIs_yellow_year_vip() {
		return is_yellow_year_vip;
	}

	public void setIs_yellow_year_vip(String is_yellow_year_vip) {
		this.is_yellow_year_vip = is_yellow_year_vip;
	}

	public String getOpenid() {
		return openid;
	}

	public void setOpenid(String openid) {
		this.openid = openid;
	}

	@Override
	public String toString() {
		return "QQInfo [is_yellow_vip=" + is_yellow_vip + ", yellow_vip_level="
				+ yellow_vip_level + ", profile_image_url=" + profile_image_url
				+ ", screen_name=" + screen_name + ", msg=" + msg + ", vip="
				+ vip + ", city=" + city + ", gender=" + gender + ", province="
				+ province + ", level=" + level + ", is_yellow_year_vip="
				+ is_yellow_year_vip + ", openid=" + openid + "]";
	}

	

}
